(72,1,'45.1','Operar plantas de procesamiento de recursos hidrobiológicos de CHD/CHI, sin contar con  los  equipos  e  instrumentos que establece la normativa correspondiente; u omitir su instalación cuando se encuentren obligados a ello.\r\nEn caso de plantas de CHD/CHI que no cuentan con los citados equipos e instrumentos.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(73,1,'45.2','Operar plantas de procesamiento de recursos hidrobiológicos de CHD, de CHI, de harina resiudual o de reaprovechamiento, teniendo los  equipos  e  instrumentos que establece la normativa correspondiente y no utilizarlos.\r\nEn caso de tenerlos y no utilizarlos.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(74,1,'45.3','Operar plantas de procesamiento de recursos hidrobiológicos de CHD, de harina residual, sin contar con  los  equipos  e  instrumentos que establece la normativa correspondiente; u omitir su instalación cuando se encuentren obligados a ello.\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(75,1,'45.4','Operar plantas de reaprovechamiento, sin contar con  los  equipos  e  instrumentos que establece la normativa correspondiente; u omitir su instalación cuando se encuentren obligados a ello.\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(76,1,'75.1','Extraer recursos hidrobiológicos con volúmenes mayores a la capacidad de bodega autorizada en el permiso de pesca. Para embarcaciones con capacidad de bodega mayor de 50 metros cúbicos, en  caso  que  el  exceso  supere  el 3% y hasta el 15% de la capacidad establecida en su permiso de pesca, así como, para embarcaciones con capacidad  de  bodega  igual  o  menor de 50 metros cúbicos, en caso que el exceso supere el 6% y hasta el 15% de la capacidad establecida en su permiso de pesca.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(77,1,'75.2','Extraer recursos hidrobiológicos con volúmenes mayores a la capacidad de bodega autorizada en el permiso de pesca. En los casos en que el exceso sea mayor al 15% de la capacidad de bodega  establecida  en  su  permiso de pesca en cualquier clase de embarcación pesquera.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(78,1,'76.1','Realizar actividades extractivas de recursos  hidrobiológicos  suplantando la identificación de una embarcación pesquera.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(79,1,'76.2','Realizar actividades extractivas de recursos hidrobiológicos suplantando la identidad de una embarcación utilizando otra embarcación con permiso de pesca o con éste suspendido\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(80,1,'77.1','Alterar o descalibrar los instrumentos de pesaje.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(81,1,'77.2','No calibrar los instrumentos de pesaje en los plazos establecidos en las disposiciones legales.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(82,1,'78','No imprimir en el Reporte de Pesaje     (wincha)     las     alertas y las modificaciones a los parámetros de calibración, según lo establecido en la norma legal correspondiente.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(83,1,'79.1','Incumplir los requisitos técnicos y metrológicos para los instrumentos de pesaje establecidos en las Resoluciones Ministeriales N° 358-2004-PRODUCE, 191-2010- PRODUCE o  en  los  dispositivos legales que las sustituyan, modifiquen o amplíen.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(84,1,'79.2','Incumplir los requisitos técnicos y metrológicos para los instrumentos de pesaje establecidos en las Resoluciones   Ministeriales   N° 358-2004-PRODUCE, 191-2010- PRODUCE o  en  los  dispositivos legales que las sustituyan, modifiquen o amplíen. Operar      con       instrumentos      de pesaje que superen los errores máximos permisibles o de tolerancia establecidos.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(85,1,'79.3','Incumplir los requisitos técnicos y metrológicos para los instrumentos de pesaje establecidos en las Resoluciones   Ministeriales   N° 358-2004-PRODUCE, 191-2010- PRODUCE o  en  los  dispositivos legales que las sustituyan, modifiquen o amplíen. Mantener    instalado    en    cualquiera de las computadoras de la planta el software de programación del sistema de los instrumentos de pesaje o instalar el software del sistema operativo del dispositivo indicador de control en forma encriptado.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(86,1,'79.4','Incumplir los requisitos técnicos y metrológicos para los instrumentos de pesaje establecidos en las Resoluciones   Ministeriales   N° 358-2004-PRODUCE, 191-2010- PRODUCE o  en  los  dispositivos legales que las sustituyan, modifiquen o amplíen. Modificar las claves de acceso al módulo de calibración  del  dispositivo indicador de control o modificar los parámetros de calibración.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(87,1,'79.5','Incumplir los requisitos técnicos y metrológicos para los instrumentos de pesaje establecidos en las Resoluciones   Ministeriales   N° 358-2004-PRODUCE, 191-2010- PRODUCE o  en  los  dispositivos legales que las sustituyan, modifiquen o amplíen. No contar con la capacidad de almacenamiento de datos en la memoria del dispositivo indicador de control, conforme a lo dispuesto en la norma correspondiente.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(88,1,'79.6','Incumplir los requisitos técnicos y metrológicos para los instrumentos de pesaje establecidos en las Resoluciones   Ministeriales   N° 358-2004-PRODUCE, 191-2010- PRODUCE o  en  los  dispositivos legales que las sustituyan, modifiquen o amplíen. Negarse a proporcionar las especificaciones  técnicas  de  los puertos de salida del dispositivo indicador de control que permita el acceso al software de su sistema operativo, al módulo de calibración o a la memoria de su base de datos.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(89,1,'79.7','Incumplir los requisitos técnicos y metrológicos para los instrumentos de pesaje establecidos en las Resoluciones   Ministeriales   N° 358-2004-PRODUCE, 191-2010- PRODUCE o  en  los  dispositivos legales que las sustituyan, modifiquen o amplíen. Permitir el acceso a los componentes internos del dispositivo indicador de control sin la presencia del inspector.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(90,1,'79.8','Incumplir los requisitos técnicos y metrológicos para los instrumentos de pesaje establecidos en las Resoluciones   Ministeriales   N° 358-2004-PRODUCE, 191-2010- PRODUCE o  en  los  dispositivos legales que las sustituyan, modifiquen o amplíen. Romper o remover los precintos de seguridad de los instrumentos de pesaje, sin autorización.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(91,1,'79.9','Incumplir los requisitos técnicos y metrológicos para los instrumentos de pesaje establecidos en las Resoluciones   Ministeriales   N° 358-2004-PRODUCE, 191-2010- PRODUCE o  en  los  dispositivos legales que las sustituyan, modifiquen o amplíen. No contar con pesas patrón calibradas, de acuerdo a lo dispuesto en la norma correspondiente.\r\nNo contar con pesas patrón calibradas, de acuerdo a lo dispuesto en la norma correspondiente.\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(92,1,'79.10','Incumplir los requisitos técnicos y metrológicos para los instrumentos de pesaje establecidos en las Resoluciones   Ministeriales   N° 358-2004-PRODUCE, 191-2010- PRODUCE o  en  los  dispositivos legales que las sustituyan, modifiquen o amplíen. Impedir   o   no   prestar   apoyo   para la ejecución de pruebas de pesaje inopinadas o aleatorias.\r\nImpedir   o   no   prestar   apoyo   para la ejecución de pruebas de pesaje inopinadas o aleatorias.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(93,1,'80','Realizar faenas de pesca incumpliendo con la correcta identificación de la embarcación pesquera, conforme a lo establecido por la Autoridad Marítima en la R.D. N° 275-2004-DCG u otra norma que la modifique o sustituya.\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(94,1,'81','Procesar los recursos hidrobiológicos sardina, jurel y caballa para la elaboración de harina de pescado, así como descargar   dichos   recursos   en los citados establecimientos industriales pesqueros.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(95,1,'82','Realizar más de una faena de pesca de recursos hidrobiológicos plenamente explotados en un intervalo de 24 horas, comprendido entre las 8 a.m. y las 8 a.m. del día siguiente.\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(96,1,'83','Almacenar o transportar, indistintamente, en cajas sin hielo, en estado de descomposición, a granel en volquetes o camiones, a granel en la cubierta o en la bodega de embarcaciones pesqueras sin hielo, recursos hidrobiológicos destinados al consumo humano directo, contraviniendo las normas del ordenamiento pesquero.\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(97,1,'95','Efectuar     descargas     parciales de RR.HH capturados en una faena  de  pesca  en  más  de  un EIP para CHI o retirarse del lugar de descarga o desembarque, sin haber descargado la totalidad de los RR.HH.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(98,1,'97','No     enviar     información     vía correo  electrónico  cifrado  en forma inmediata y automática sobre descargas de recursos hidrobiológicos,       conforme       a lo dispuesto mediante las disposiciones legales.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(99,1,'98','No dar aviso anticipado (fax o correo electrónico) a la empresa Certificadora/Supervisora encargada del Programa de Vigilancia y Control de la Pesca y Desembarques en el Ámbito Marítimo,   del   arribo   a   puerto de una embarcación dentro del régimen de los LMCE.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(100,1,'99','Iniciar la descarga de recursos hidrobiológicos  sin  la  presencia de los inspectores de la empresa Certificadora/ Supervisora designada  por  el  Ministerio  de la Producción para el control de LMCE.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(101,1,'100.1','Extraer recursos hidrobiológicos con     una     embarcación     que ha  incorporado  en  forma definitiva   su   PMCE   a   otra   u otras embarcaciones del mismo armador.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(102,1,'100.2','Extraer recursos hidrobiológicos con     una     embarcación no nominada por el armador para realizar actividades pesqueras en la temperada de pesca.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(103,1,'102','Entrega deliberada de información falsa, el ocultamiento, destrucción o alteración de libros, registros, documentos que hayan sido requeridos por el Ministerio de la Producción, o por las empresas Certificadoras/Supervisoras designadas por el Ministerio.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(104,1,'104','Realizar actividad extractiva artesanal del recurso anchoveta para CHD sin registrar la embarcación    en    la    Dirección o Gerencia Regional de la Producción correspondiente.\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(105,1,'113','Descarga del recurso anchoveta con destino al consumo humano directo, utilizando sistemas de bombeo submarino, sin bomba peristáltica o sin bomba de vacío y sin el empleo de agua refrigerada recirculada.\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(106,1,'114','Recepción del recurso anchoveta no apto para el consumo humano directo, en plantas de consumo humano directo, en porcentajes mayores al 10% de volumen descargado de la embarcación pesquera.\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(107,1,'115','Recepción o procesamiento de descartes  y/o  residuos  que  no sean tales, y/o no procedan de establecimientos industriales pesqueros para consumo humano directo que no cuentan con planta de  harina  de  pescado  residual y/o de los desembarcaderos artesanales.\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(108,1,'116','Almacenarrecursoshidrobiológicos para consumo humano directo en condiciones    inadecuadas    para su conservación, que conlleve a deterioro.\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(109,1,'117','Realizar   actividades   extractivas o de descarga cubriendo parcial o totalmente el nombre y/o la matrícula de la embarcación pesquera artesanal, de menor o mayor escala.\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(110,1,'123.1','No comunicar, al Ministerio de la Producción según el procedimiento establecido, la extracción de ejemplares en tallas o pesos menores que superen los límites de tolerancia establecidos en la normativa vigente.\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(111,1,'124.1','Transportar vía terrestre harina residual de recursos hidrobiológicos, harina y aceite de pescado sin el correspondiente certificado de procedencia.\r\n\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(112,1,'125.1','No recibir o procesar los descartes o residuos que generen las plantas de procesamiento de productos pesqueros para consumo humano directo o limitar su recepción.\r\n\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(113,1,'126','Destinar el recurso anchoveta a la elaboración de harina residual, por razones de selección de talla, peso o calidad, en un porcentaje mayor al permitido por la norma.\r\n\r\n\r\n','<?xml version=\"1.0\"?>\n<root/>\n',1),
(114,1,'127','Incumplir las condiciones para operar las plantas de reaprovechamiento.','<?xml version=\"1.0\"?>\n<root/>\n',1),
